
function Layout(){this.registerSubmenu=function(){var a=$(".containerSubmenu");$(".submenu").on("click",function(d){if(!a.hasClass("open")){var c=$(d.currentTarget);var b=c.data("url");app.ajax(b,{},"GET",function(e){a.html(e)})}a.toggleClass("open")})},this.registerEvents=function(){this.registerSubmenu();$(".link").on("click",function(c){var b=$(c.currentTarget);var a=b.data("url");app.pjax(a,{},"GET",function(d){})});$(".carousel").carousel({interval:5000})}}jQuery(document).ready(function(){var a=new Layout();a.registerEvents()});